import Sdata from "./Sdata";

ReactDOM.render(
  <>
   <Card imgsrc={"Sdata[0].imgsrc"} title="Sdata[0].title" name="Sdata[0].name" link="Sdata[0].link" />
   <Card imgsrc="Sdata[1].imgsrc" title="Sdata[1].title" name="Sdata[1].name" link="Sdata[1].link" />
   <Card imgsrc="Sdata[2].imgsrc" title="Sdata[2].title" name="Sdata[2].name" link="Sdata[2].link" />


  </>,

document.getElementById("root"));
